import * as React from 'react';
import { View, Text, StyleSheet, Pressable } from 'react-native';



const EntranceScreen = ({navigation}) => {
    const onConsumerClick = () => {
        navigation.navigate("ConsumerLogin");
    };
    const onCompanyClick = () => {
      navigation.navigate("CompanyLogin");
  };
    return(
    <View style={styles.container}>
        <View style={styles.textContainer} >
            <Text style={styles.textStyle}>Smart Food</Text>
        </View>
        <View style={styles.buttonContainer}>
            <Pressable style={styles.pressableStyle}  onPress={onConsumerClick}>
                <Text>Potro≈°nik</Text>
            </Pressable>
            <Pressable style={styles.pressableStyle} onPress={onCompanyClick}>
                <Text>Podjetje / Restavracija</Text>
            </Pressable>
        </View>
        <View style={styles.emptyView}/>
    </View>
    );
  };
const styles = StyleSheet.create({
  container: {
      flex:1,
      backgroundColor:"white"
  },
  textContainer: {
    flex:4,
    justifyContent:'flex-end',
    alignItems:'center',
    backgroundColor:'transparent',
  },
  textStyle:{
      fontSize:26,
      bottom:50
  },
  buttonContainer: {
    flex:5,
    justifyContent:'space-evenly',
    alignItems:'center',
    backgroundColor:'transparent',
  },
  pressableStyle:{
    borderColor:'rgba(0,0,0,0.8)',
    borderWidth:0.5,
    alignItems:'center',
    justifyContent:'center',
    alignContent:'center',
    width:300,
    height:"24%",
    elevation:5,
    borderRadius:100,
  },
  emptyView:{
      flex:2
  }
});

export default EntranceScreen;
